import styled from 'styled-components';
import {Background, Primary} from './Colors.js'

export default styled.div`
	display: flex;
	flex-flow: row wrap;
	justify-content: center;
	padding-right: 15px;
  padding-left: 15px;
  padding-bottom: 15px;
  margin: 0 auto;
  background-color: ${Background};
  border: 1px solid ${Primary};
`;
